import React from 'react';
import './customerWindowGUI.css'


function MenuItems(props) {
    const{items} = props;
    return (
        <main className = "block width-2">
            <h2>Menu Items</h2>
            <div className="row"></div>
            {items.map((item) => (
                <items key={item.id} item={item}></items>
            ))}
        </main>
    )
}

export default MenuItems;
